import React from 'react';
import styled from 'styled-components';

const Header = styled.div`
	text-align: left;
	height: 42px;
	line-height: 42px;
	border-bottom: 1px solid #e2e8ed;

	&.white {
		background: #ffffff;
	}
	&.black {
		background: #0b0102;
	}
`;

const CoxLogo = styled.img`
	width: auto;
	height: 23px;
	margin: 9.5px 25px;
`;

const HomeNav = styled.a`
	text-decoration: none;
`;

const header = (props) => (
	<Header className={props.color}>
		<HomeNav href="/"><CoxLogo src="assets/images/cox-logo-gradient.png" alt="cox logo" /></HomeNav>
	</Header>
)

export default header;
